function Divide(number, divide) {
    if(!number) return new Error("Number] No Number Specified")
    if(isNaN(number)) return new Error("[Number] Number, No Letters Or Symbols")
    if(!divide) return new Error("Divider] No Divider Specified")
    if(isNaN(number)) return new Error("[Divider] Number, No Letters Or Symbols")
    return number / divide;
}

module.exports = Divide